import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Signup from './pages/signup/signup';
function App() {
  return (
    <div className="App">
      <Router>
          <Route path="/signup" component={Signup}></Route>
      </Router>
    </div>
  );
}

export default App;
